import React from 'react';
import SampleNextArrow from './SampleNextArrow'; // Adjust the path as necessary
import SamplePrevArrow from './SamplePrevArrow'; // Assuming you also have a SamplePrevArrow component
import Slider from 'react-slick'; // Import the carousel package

function Home() {
  return (
    <div>
      <h2>Carousel Example</h2>
      <Slider
        nextArrow={<SampleNextArrow />}
        prevArrow={<SamplePrevArrow />}
      >
        {/* Your carousel slides here */}
      </Slider>
    </div>
  );
}

export default Home;
